import React from 'react';
import '../App.css';
import Tab from './Tab';

class InterestArea extends React.Component {

getInterests() {
    let interests = [];

    for (const int of Object.values(this.props.interests)) {
      interests.push (
        <Tab title={int}/>
      )
    }
    return interests;
  }

  render() {
    return (

      <div class="container-fluid">
        <div class="row">
          <div class="col-lg-6" >{this.getInterests()}</div>
        </div>
      </div>

    )
  }
}

export default InterestArea;
